import React from 'react';

function App() {
    const title = 'Blog Post';
    const body = 'This is my blog post';
    const commetn = [

        {id: 1, text: 'comment one'},
        {id: 2, text: 'comment two'},
        {id: 3, text: 'comment three'}

    ];
    return (
        <div className='container'>
            <h1>{title}</h1>
            <p>{body}</p>
            { Math.floor(Math.random() * 10)}
        </div>
    )

}
export default App;
